The console_error_panic_hook crate logs unexpected panics to the developer console via console.error. Rather than getting cryptic, difficult-to-debug RuntimeError: unreachable executed error messages, this gives you Rust's formatted panic message. All you need to do is install the hook by calling console_error_panic_hook::set_once() in an initialization function or common code path: #[wasm_bindgen]
pub fn init_panic_hook() { console_error_panic_hook::set_once();
}

