On the Web, I/O is always asynchronous, and there isn't a file system. Factor I/O out of your library, let users perform the I/O and then pass the input slices to your library instead. For example, refactor this: use std::fs;
use std::path::Path; pub fn parse_thing(path: &Path) -> Result<MyThing, MyError> { let contents = fs::read(path)?; // ...
} Into this: pub fn parse_thing(contents: &[u8]) -> Result<MyThing, MyError> { // ...
}

